drop table delays;
create table delays (
    flight_id           INTEGER,
	departure_delay	    INTEGER,
    arrival_delay	    INTEGER,
    carrier_delay	    INTEGER,
    weather_delay	    INTEGER,
    NAS_delay		    INTEGER,
    security_delay		INTEGER,
    late_aircraft_delay	INTEGER,
    foreign key         (flight_id)
        references      flights(flight_id)
);
